Template.vokabelDetail.onCreated(function() {
  let self = this;
  self.autorun(function() {
    let vocabularyId = FlowRouter.getParam('id');
    self.subscribe('singleVocabulary', vocabularyId);
  });
});

Template.vokabelDetail.helpers({
  entry() {
    let vocabularyId = FlowRouter.getParam('id');
    let entry = Vocabulary.findOne({_id: vocabularyId}) || {};
    return entry;
  }
});
